    private void casa(GraphicsContext gc) {
        //exterior
        gc.setStroke(Color.BLACK);
        gc.setFill(Color.WHITE);
        gc.fillRect(400, 270, 260, 240);
        gc.strokeRect(400, 270, 260, 240);
        //Techo
        gc.setFill(Color.RED);
        gc.beginPath();
        gc.appendSVGPath("M 555 180 L 380 270 L 680 270 L 535 180 ");
        gc.closePath();
        gc.fill();
        gc.stroke();
        //puerta
        gc.setFill(Color.BROWN);
        gc.fillRect(470, 390, 90, 120);
        gc.strokeRect(470, 390, 90, 120);
        //ventanas
        gc.setLineWidth(3);
        gc.strokeOval(430, 300, 50, 50);
        gc.setFill(colorDeVentanaEnLaCasa);
        gc.fillOval(430, 300, 50, 50);
        gc.strokeOval(500, 300, 50, 50);
        gc.fillOval(500, 300, 50, 50);
        gc.strokeOval(570, 300, 50, 50);
        gc.fillOval(570, 300, 50, 50);
    }

