    private void noche(GraphicsContext gc) {

        RadialGradient rg1 = new RadialGradient(0, 0, .5, .5, 1, true,
                CycleMethod.REFLECT,
                new Stop(0.0, Color.ANTIQUEWHITE),
                new Stop(1.0, Color.WHITE));
        gc.setFill(rg1);
        int x = 250;
        for (int i = 0; i < 4; i++) {
            gc.fillOval(x, 50, 100, 40);
            gc.fillOval(x + 50, 70, 80, 40);
            gc.fillOval(x - 30, 70, 100, 40);

            x = x + 200;
        }
        x = 250;

        for (int i = 0; i < 3; i++) {
            gc.fillOval(x + 80, 120, 100, 40);
            gc.fillOval(x + 120, 140, 80, 40);
            gc.fillOval(x + 50, 140, 100, 40);

            x = x + 200;
        }
        gc.setFill(Color.FORESTGREEN);
        gc.fillArc(0, 360, 1024, 150, 0, 180, ArcType.OPEN);
        gc.fillRect(0, 430, 1024, 320);

        nightTree(gc);
        colorDeVentanaEnLaCasa = Color.YELLOW;
        casa(gc);
        // nightNumb(gc);
    }

